class Content extends React.Component {
  

 
  render() {
    if(this.props.action === "findSound"){
    return(
      <FindSound />
    )
  }else if(this.props.action === "findArtist"){
    return(
      <FindArtist />
    )
  }
  }
}

export default Content;
